import React from 'react';
import './App.css';

export default class CardView extends React.Component {


	constructor(props) {
  		super(props);
  		console.log("CardView: ", typeof props.card);
	}


	render() {
		const card = <img src={this.props.card.image()} alt="a card you can't see"/>

		return (
			<div>
				{ card }
			</div>
		);
	}
}
